class Solution {
public:
    int totalHammingDistance(vector<int>& nums) {
     
        register int hamming_dist = 0;
		int num_size = nums.size();
        if(num_size == 0) return 0;
        for(register int i = 0; i < num_size - 1; i++){
            for(register int j = i + 1; j < num_size; ++j){
                register uint32_t x = nums[j] ^ nums[i];
                while( x != 0 ){
                    hamming_dist += x & 0x01; x >>= 1;
					hamming_dist += x & 0x01; x >>= 1;
					hamming_dist += x & 0x01; x >>= 1;
				}
            }
        }
    return hamming_dist;
    }
};

